INSERT INTO `news` (`news_id`, `news_description`, `news_time`, `news_status`, `news_title`) VALUES
(129, 'Market is live NOW', '11:05:00', 1, 'Market is live NOW'),
(130, 'There''s been an huge crash seemed in the market.', '11:27:00', 1, 'Market has been crashed.'),
(131, 'Market is LIVE', '11:50:00', 1, 'Market is LIVE'),
(132, 'Those who used unfair means to increase their cash and assets will be disqualified', '12:35:00', 1, 'Disqualification for Unfair means'),
(133, 'Airtel is planning to buy more spectrum''s for 5G. they now are finding the investors.', '13:30:00', 1, 'There is new boom for Airtel.'),
(134, 'Zee Entertainment now are planning to show the live coverage of all Real Madrid games. The CEO CHETAN SAVDEKAR confirmed the news.', '13:34:00', 1, 'ZEE ENTERTAINMENT now will telecast REAL MADRID GAMES.'),
(135, 'PepsiCo India may emerge from the setback caused by demonetisation only by the April-June quarter, global chief executive officer Indra Nooyi said, the seventh leader among consumer companies to voice concerns over the note bans significant impact on sales. \r\n\r\n', '13:48:00', 1, 'emonetisation had a significant impact on India business in Q4: Indra Nooyi, Global CEO, Pepsico '),
(136, 'The bakery and dairy products maker has reported consolidated profit at Rs 216 crore, growth of 1.4 percent year-on-year but higher by 2.5 percent sequentially due to cost efficiency program.', '13:51:00', 1, 'Good Q1 earnings lift Britannia Industries to record high, stock price up 8%'),
(137, 'Dewan Housing Finance Corporation Ltd (DHFL) on Friday Afternoon, reduced the lending rate by 0.2 per cent to 9.35 per cent to cash in on the festival fervour. The revised rate of 9.35 per cent for its new customers would be effective from October 11, DHFL said in a statement.', '14:35:00', 1, 'DHFL cuts home loan rate by 0.2%'),
(138, 'Drug major Dr Reddy''s Laboratories expects the first quarter of the ongoing fiscal to witness a temporary decline in sales in India due to de-stocking by trade on the implementation of Goods and Services Tax (GST).', '14:40:00', 1, 'Expect lower sales for Dr. Reddys in Q1 due to GST implementation.'),
(139, 'The vehicles manufacturer MAHINDRA announced its foray into the digital marketplace with apps to cater to diagnostics, service, fleet management, and spare parts of customers. These apps wont generate much revenues but will add to the whole ownership exeprience', '14:45:00', 1, 'MAHINDRA INTRODUCES FOUR APPS TO TAP DIGITAL MARKETPLACE'),
(140, 'Employees of the Britannia biscuit manufacturing plant in Bengaluru to go on a 5 day strike. This has been done to draw attention towards the suicide of an employee of the factory. The Bengaluru factory of Britannia is the biggest factory and produces most of the volume to support the south of India. And a 5 day strike will adversley affect the company.', '14:55:00', 1, 'Britannia factory employees go on a 5 day strike'),
(141, 'Bank of Baroda has reviewed the MCLR rates and kept them unchanged with effect from 07 September 2017 as under -\r\nOvernight - 8.10%,One month - 8.15%,Three month - 8.20%,Six month - 8.30%,One year - 8.35%,Three year - 8.50%,Five year - 8.65%.', '15:05:00', 1, 'Bank of Baroda keeps MCLR unchanged'),
(142, 'Market for today will be closed at 4:00 PM.', '15:00:00', 1, 'IMPORTANT'),
(143, 'Market closing at 3:30.', '15:30:00', 1, 'Market Closing shortly.'),
(144, 'Winners-\r\n1.Chaitanya Sonavane\r\n2.Tushar Bhutada\r\n3. Megh Khaire\r\n\r\nAll participants are requested to collect the certificates today itself before 5pm.\r\n\r\nThank You for Playing WALLSTREET. Hope you all enjoyed it.', '16:09:00', 1, 'Winners Declared');
